// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

import "./CollectCoin.sol";
import "./Haltable.sol";
import "./IPricingStrategy.sol";

contract SimplePreSale is Haltable {

    using SafeMath for uint256;

    /* The token we are selling */
    CollectCoin public token;

    // How we are going to price our offering
    IPricingStrategy public pricingStrategy;

    /* the UNIX timestamp start date of the ico */
    uint public startsAt;

    // tokens will be transfered from this address
    address payable public multisigWallet;

    /* Maximum amount of tokens this crowdsale can sell. */
    uint256 public maximumSellableTokens;

    uint256 public tokenInvestorCap;

    /* How many distinct addresses have invested */
    uint public investorCount = 0;

    /* List of all investors */
    address[] public investors;

    /* Has this crowdsale been finalized */
    bool public finalized;

    /* the number of tokens already sold through this contract*/
    uint public tokensSold = 0;

    /* How many wei of funding we have raised */
    uint public weiRaised = 0;

    /** State machine
    *
    * - Preparing: All contract initialization calls and variables have not been set yet
    * - Funding: Active crowdsale
    * - Finalized: The finalized has been called and succesfully executed
    */
    enum State { Unknown, Locked, Funding, Finalized }

    // A new investment was made
    event Invested(address investor, uint weiAmount, uint tokenAmount);

    event Whitelisted(address addr, bool status);

    /** Addresses that are allowed to invest even before ICO offical opens. For testing, for ICO partners, etc. */
    mapping (address => bool) public earlyParticipantWhitelist;

    /** How much ETH each address has invested to this crowdsale */
    mapping (address => uint256) public investedAmountOf;

    /** How much tokens this crowdsale has credited for each investor address */
    mapping (address => uint256) public tokenAmountOf;

    /** Modified allowing execution only if the crowdsale is currently running.  */
    modifier inState(State state) {
        if(getState() != state) revert();
        _;
    }

    constructor(address _token, uint256 _startsAt, uint256 _investorTokenCap, IPricingStrategy _pricingStrategy, address payable _multisigWallet, uint256 _maximumSellableTokens) 
    {
        require(_multisigWallet != address(0), "multisig wallet zero address");

        startsAt = _startsAt;
        token = CollectCoin(_token);
        pricingStrategy = _pricingStrategy;
        maximumSellableTokens = _maximumSellableTokens * 10**token.decimals();
        tokenInvestorCap = _investorTokenCap * 10**token.decimals();

        multisigWallet = _multisigWallet;
    }

    function setStartsAt(uint256 _startsAt) public onlyOwner {
        startsAt = _startsAt;
    }

    function setEarlyParicipantWhitelist(address addr, bool status) onlyOwner public {
        earlyParticipantWhitelist[addr] = status;
        emit Whitelisted(addr, status);
    }

    function availableInvestment() public view returns(uint256)
    {
        return tokenInvestorCap - tokenAmountOf[msg.sender];
    }

    /**
    * @dev Make an investment.
    *
    * Crowdsale must be running for one to invest.
    * We must have not pressed the emergency brake.
    *
    * @param receiver The Ethereum address who receives the tokens
    * @param tokenAmount Amount of tokens which be credited to receiver
    *
    * @return tokensBought How mony tokens were bought
    */
    function buyTokens(address receiver, uint256 tokenAmount) 
                stopInEmergency 
                internal 
                returns(uint tokensBought) 
    {
        // Are we whitelisted for early deposit
        if(!earlyParticipantWhitelist[receiver]) 
        {
            revert();
        }

        if(getState() != State.Funding) 
        {
            revert();
        }

        uint weiAmount = msg.value;

        // Dust transaction
        require(tokenAmount != 0);

        // don't allow investment to exceed the investor cap
        require(tokenAmountOf[receiver] + tokenAmount <= tokenInvestorCap);

        // Check that we did not bust the cap
        require(!isBreakingCap(tokenAmount, tokensSold));

        if(investedAmountOf[receiver] == 0) {
            // A new investor
            investorCount++;
            investors.push(receiver);
        }

        // Update investor
        investedAmountOf[receiver] = investedAmountOf[receiver].add(weiAmount);
        tokenAmountOf[receiver] = tokenAmountOf[receiver].add(tokenAmount);

        // Update totals
        weiRaised = weiRaised.add(weiAmount);
        tokensSold = tokensSold.add(tokenAmount);

        // transfer the amount of tokens to the time locked wallet
        token.transfer(receiver, tokenAmount);

        // Pocket the money, or fail the transaction if we for some reason cannot send the money to our multisig
        if(!multisigWallet.send(weiAmount)) revert();

        // Tell us invest was success
        emit Invested(receiver, weiAmount, tokenAmount);

        return (tokenAmount);
    }

    // ONLY FOR TEST PURPOSE
    function reset() public onlyOwner {
        weiRaised = 0;
        tokensSold = 0;
        investorCount = 0;
    }

    /**
    * Finalize a succcesful crowdsale.
    *
    * The owner can triggre a call the contract that provides post-crowdsale actions, like releasing the tokens.
    */
    function finalize() public inState(State.Funding) onlyOwner stopInEmergency {

        // Already finalized
        if(finalized) {
            revert();
        }

        finalized = true;
    }

    /**
    * Check if the current invested breaks our cap rules.
    *
    *
    * The child contract must define their own cap setting rules.
    * We allow a lot of flexibility through different capping strategies (ETH, token count)
    * Called from invest().
    *
    * @param tokenAmount The amount of tokens we try to give to the investor in the current transaction
    * @param tokensSoldTotal What would be our total sold tokens count after this transaction
    *
    * @return limitBroken is true if taking this investment would break our cap rules
    */
    function isBreakingCap(uint tokenAmount, uint tokensSoldTotal) public view returns (bool limitBroken) 
    {
        return tokensSoldTotal + tokenAmount > maximumSellableTokens;
    }

    /**
    * state machine management.
    *
    * We make it a function and do not assign the result to a variable, so there is no chance of the variable being stale.
    */
    function getState() public view returns (State) {
        if (block.timestamp < startsAt) return State.Locked;
        else if(finalized) return State.Finalized;
        else if(maximumSellableTokens - tokensSold == 0) return State.Finalized;
        else return State.Funding;
    }

    function getAllInvestors() public view returns (address[] memory)
    {
        return investors;
    }

    function getTokenPrice() public view returns (uint unitPrice, uint feedPrice)
    {
        return pricingStrategy.currentUnitPrice(tokensSold);
    }

    // -----------------------------------------
    // Crowdsale external interface
    // -----------------------------------------

    fallback () external payable {
        revert();
    }

    /**
    * @dev low level token purchase ***DO NOT OVERRIDE***
    * @param _beneficiary Address performing the token purchase
    */
    function buyTokens(address _beneficiary) public payable {

        uint256 weiAmount = msg.value;
        _preValidatePurchase(_beneficiary, weiAmount);

        // calculate token amount to be created
        uint256 tokens = _getTokenAmount(weiAmount);

        buyTokens(_beneficiary, tokens);
    }

    receive () external inState(State.Funding) payable {
        buyTokens(msg.sender);
    }

    // -----------------------------------------
    // Internal interface (extensible)
    // -----------------------------------------

    /**
    * @dev Validation of an incoming purchase. Use require statements to revert state when conditions are not met. Use super to concatenate validations.
    * @param _beneficiary Address performing the token purchase
    * @param _weiAmount Value in wei involved in the purchase
    */
    function _preValidatePurchase(address _beneficiary, uint256 _weiAmount) internal pure {
        require(_beneficiary != address(0));
        require(_weiAmount != 0);
    }

    /**
    * @dev Override to extend the way in which ether is converted to tokens.
    * @param _weiAmount Value in wei to be converted into tokens
    * @return Number of tokens that can be purchased with the specified _weiAmount
    */
    function _getTokenAmount(uint256 _weiAmount) internal view returns (uint256) {
        uint256 tokenAmount = pricingStrategy.calculateTokenAmount(_weiAmount, weiRaised, tokensSold, address(0), token.decimals());
        return tokenAmount;
    }
}

